import {useEffect, useState} from 'react'
import axios from 'axios'
import Card from '../Card/Card';


const Home = () => {
    const API = "http://localhost:3001/videogames?page=1";
    const [videoGames, setVideoGames] = useState([]);
  const getVideogames = async () => {
    const { data } = await axios.get(`${API}`);
    console.log(data);
    setVideoGames(data);
  };

  useEffect(() => {
    getVideogames();
  }, [setVideoGames]);
  return (
    <main>
    {videoGames?.map((game) => {
      return (
        <Card
          key={game.id}
          id={game.id}
          name={game.nombre}
          image={game.imagen}
          plataforms={game.plataformas}
          genero={game.genero}
        />
      );
    })}
  </main>
  )
}

export default Home
